import React from "react";

const SpinnerPage = () => {
  return (
    <>
      <div class="spinner-border fast" role="status">
        <span class="sr-only">Loading...</span>
      </div>
      <div class="spinner-grow fast ml-3" role="status">
        <span class="sr-only">Loading...</span>
      </div>
    </>
  );
}

export default SpinnerPage;
